/* Import statements */
import React, { Component } from "react";
import { Link, Route, Switch } from "react-router-dom";
import todo from "./pages/to-do/todo";
import './App.css';


/* Componente Pagina Inicial */
const main = () => (
  <div>
    <h2>Home</h2>
  </div>
);

/* Componente Categoria */
const postagens= () => (
  <div>
    <h2>Postagens</h2>
  </div>
);

/* Componente de Artigos */
const albuns = () => (
  <div>
    <h2>Álbuns</h2>
  </div>
);

/* Componente de Artigos */
const todos = () => (
  <div>
    <h2>TO-DOs</h2>
  </div>
);

export default function App() {
  return (
    <div>
      <nav className="navbar">
        <ul className="App-link">

            <Link className="App-link" to="/">Pagina inicial</Link>

          <li>
            <Link className="App-link" to="/postagens">Postagens</Link>
          </li>
          <li>
            <Link className="App-link" to="/albuns">Álbuns</Link>
          </li>
          <li>
            <Link className="App-link" to="/todos">TO-DOs</Link>
          </li>
        </ul>
      </nav>
      /* Os componentes da rota são renderizados se o caminho prop corresponder ao URL atual */
      <Route path="/" component={main} />
      <Route path="/postagens" component={postagens} />
      <Route path="/albuns" component={albuns} />
      <Route path="/todos" component={todo} />
    </div>
  );
}
